 ALTER TABLE Transport_Provider
ALTER COLUMN [Name] VARCHAR(255);
Insert into Transport_Provider([Name], One_Way_Payment, Return_Payment, Mileage_Fees)
select distinct Confirmation, One_Way, two_way, cast(avg(cast (mileage_fee as float))as VARCHAR) as Mileage_fee from [DATA] GROUP BY confirmation, one_way, two_way;
