Insert into Client_has_Transport_Provider
select distinct (select client.idClient from Client where Client.[Name]= Client_Name), (select top 1 Transport_Provider.idTransport_Provider from Transport_Provider where Transport_Provider.[Name]= Confirmation) from [DATA];

